import React from 'react';

const Dashboard = () => {
  return (
    <div>
      <h1 className="text-2xl font-semibold text-gray-900 mb-6">Dashboard</h1>
      <p className="text-gray-600">Welcome to the 3D Printer Management System</p>
    </div>
  );
};

export default Dashboard;
